import React, { PureComponent } from 'react';
import "./Left.css";
import Top1 from "./Top1.js";
import Top2 from "./Top2.js";
import Top3 from "./Top3.js";
import Top4 from "./Top4.js";

export default class HomeChartLeft extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {};
    }
	
	
    render() {
        return (
			<div id="left">
				<div className="l">
					<div className="title">文物统计</div>
					<Top1 style={{background:'url("../Image/chartAreaBig.png")', backgroundSize: '100% 100%'}}></Top1>
				</div>
				<div className="l">
					<div className="title">场馆环境实时数据</div>
					<Top2></Top2>
				</div>
				<div className="l">
					<div className="title">游客实时数据</div>
					<Top3></Top3>
				</div>
				<div className="l">
					<div className="title">场馆口碑</div>
					<Top4></Top4>				
				</div>
			</div>
        );
    }
}
